Terra firme. Plot PSE5B-10B is located within the B strip of the Piste de Saint-Élie "Biodiversity Block" and its reference system corresponds to that of the block.                                                                                                                                                                                                                                                        Inventory limited to trees with dbh between 2 and 10 cm dbh on the following 100 subplots:
- in plot PSE5B: subplots 36 to 40 and 46 to 50;
- in each of the plots PSE6B, PSE7B, PSE8B, PSSE9B: subplots 31 to 40 and 41 to 50;
- in plot PSE10B: subplots 31 to 35 and 41 to 45.
